import React from 'react';
import spinner from './spinner.gif';
import ClipLoader from "react-spinners/ClipLoader";

const Spinner = () => (
  <>
    <img
      src={spinner}
      style={{ width: '200px', margin: 'auto', display: 'block'}}
      alt='Loading...'
    />
  </>
)

export default Spinner;
